//     </Fade>
//   );
// }
const AboutMe = () => {
  return (
    <React.Fragment>
      <Navbar />
      <div
        id="download-button"
        onClick={() => {
          window.location.href =
            "https://drive.google.com/file/d/1_cl8fCnSdGW-dx0qY2OfF_bNJ6evrEgT/view?usp=sharing";
        }}
      >
        <p>Download Resume</p>
        <img src={download_icon} alt="" />
      </div>
      <div className="about-me">
        {/* <div className="large-text">
          
        <img className="background-pictures" src={} /> */}

        {/* <Footer /> */}

        {/* <div className="centered-section">
          <p>Hello, I'm Matt Ly.</p>
          <h1>Data Analyst</h1>
          <Footer />
        </div> */}
      </div>
      <div className="main-text-section">
        <div className="relative-div">
          {/* <Parallax
            className="more-about-me"
            y={["-50px", "200px"]}
            tagOuter="figure"
          >
            {/* <img src={more-about-me} alt="" className="more-about-me" /> }
          </Parallax> */}

          <div className="center">
            <div className="large-text">
              <Fade top>

                <h1>Clean Data.</h1>
                <h1>Creative.</h1>
                <h1>Critical Thinking.</h1>
                
              </Fade>

              <Fade bottom>
                <p className="first-paragraph">
                  Hi, I’m Matt Ly.
                </p>
                <div>
                  <p className="next-paragraph">
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit, 
                  sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. 
                  Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi 
                  ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit 
                  in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur 
                  sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt 
                  mollit anim id est laborum.
                  </p>
                  
                    <div
                    className="download-button-resume"
                    onClick={() => {
                      window.location.href =
                        "https://drive.google.com/file/d/14cTDRopY11iwYzCRlH7CuPGrbMFtJBJw/view?usp=sharing";
                    }}
                  >
                    <p className="text">Download Resume</p>
                    <img src={download_white} alt="" />
                    </div>
                    <img src={portrait} className="profile-pic" alt="" />
                    </div>
                  
              </Fade>
              {/* <img src={gradient_button} alt="" /> */}
            </div>
          </div>
        </div>
      </div>

    </React.Fragment>
  );
};

export default AboutMe;
